Enrich nested array items in mongodb query<p>I have a mongo collection with a pretty deep nesting. Its documents look like </p>

<pre><code>{        
    first: [
        {
            second: [
                {
                    name: "some name",
                    third: [
                        1, 2, 3
                    ]
                }
            ] 
        }
    ],
    // other fields
}
</code></pre>

<p>And I want to get the following response from the collection:</p>

<pre><code>{        
    first: [
        {
            second: [
                {
                    name: "some name",
                    third: [{
                            id: 1,
                            name: "some name"
                        }, {
                            id: 2,
                            name: "some name"
                        }, {
                            id: 3,
                            name: "some name"
                        }]
                }
            ] 
        }
    ]
}
</code></pre>

<p>I tried to use the follwing query</p>

<pre><code>db.getCollection("collection").aggregate
([     
    {
        "$addFields": { 
            "first.second.third.id": "$first.second.third.id",            
            "first.second.third.name": "$first.second.name"
        }
    }
])
</code></pre>

<p>but it had no effect. 
How do I get desired result?
Thank you in advance!</p>

