How to query multiple collections in mongodb (without using $lookup)?<p>I would like to create a single query that gets data from three different collections from providing a single query parameter. I have seen methods that use <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/lookup/" rel="nofollow noreferrer">$lookup</a> but I do not want to use that as <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/lookup/#pipe._S_lookup" rel="nofollow noreferrer">I cannot use it on sharded collections.</a></p>

<p>Here is an example to explain further.</p>

<p>I have three collections: user, chatroom and chatMessage.</p>

<p>user collection:</p>

<pre><code>{
    _id: ObjectId('456'),
    username: 'John',
    contacts: [
        {
            _id: ObjectId('AB12'),
            name: 'Mary',
            idOfContact: ObjectId('123'),
        },
        {
            _id: ObjectId('AB34'),
            name: 'Jane',
            _idOfContact: ObjectId('234'),
        },
        {
            _id: ObjectId('AB56'),
            name: 'Peter',
            _idOfContact: ObjectId('345'),
        }
    ],
}
</code></pre>

<p>chatroom collection:</p>

<pre><code>{
    _id: ObjectId('AB34'),
    usersInThisChatRoom: [
        ObjectId("456"),
        ObjectId("123"),
        ObjectId("234"),
    ]
}
</code></pre>

<p>chatMessage collection:</p>

<pre><code>[
    {
        _id: ObjectId("M01"),
        chatRoomObjectId: _id: ObjectId('AB34'),
        senderObjectId: ObjectId('456'),
        message: 'Hello humans!',
        date: ISODate("2019-09-03T07:24:28.742Z"),
    },
    ...(other messages)
]
</code></pre>

<p>What I would like to be returned</p>

<pre><code>[
    {
        chatRoomObjectId: ObjectId('AB34'),
        usersInThisChatRoom: [
            {
                contactName: 'John',
                contactUserId: ObjectId('456'),
            },
                contactName: 'Mary',
                contactUserId: ObjectId('123'),
            },
                contactName: 'Jane',
                contactUserId: ObjectId('234'),
            }
        ]
        chatMessages: [
            {
                _id: ObjectId("M01"),
                senderObjectId: ObjectId('456'),
                message: 'Hello humans!',
                date: ISODate("2019-09-03T07:24:28.742Z"),
            },
            ...(other messages)
         ]
    },  
    ...(other documents)
]
</code></pre>

<p>Is there a way to get my desired results by making a single query using the <code>user._id</code> and will that be performance friendly? </p>

<p>Or, do I have to make several queries, one after another, to achieve what I want?</p>

