MongoDB Aggregate pipeline with $group and $count on a Pointer reference returns wrong data<p>I have a set of data in MongoDB with <em>parse-server</em> in the following format-</p>

<pre><code> Rating =&gt; objectId, user&lt;_User&gt;, rating...
 _User =&gt; objectId, gender&lt;m|f|nb|na&gt;
</code></pre>

<p>I have been trying to group the data based on the user's gender to find out how many male, female, non-binary or N/A users have rated. <strong>user</strong> field in a pointer reference to <strong>_User</strong>. I am using the following aggregate pipeline.</p>

<pre><code>const pipeline = [
      {
        lookup: {
          from: '_User',
          localField: 'user',
          foreignField: 'objectId',
          as: 'user'
        }
      },
      {
        unwind: { path: '$user' }
      },
      {
        group: {
          objectId: '$user.gender',
          count: {
            $sum: 1
          }
        }
      }
    ]
const data = await new Query('Rating').aggregate(pipeline)
</code></pre>

<p>Result =></p>

<pre><code>[
        {
            "count": 54,
            "objectId": "na"
        },
        {
            "count": 405,
            "objectId": null
        },
        {
            "count": 27,
            "objectId": "f"
        },
        {
            "count": 540,
            "objectId": "m"
        }
    ],
</code></pre>

<p>However, returned data count doesn't match with actual data. <strong><em>The actual database has only 27 ratings with 1 f, 2 na, 24 m.</em></strong></p>

<p>For MongoDB developers, <em>objectId</em> is equavalent to <em>_id</em>.</p>

<p>I am a novice to aggregation framework. What am I doing wrong?</p>

<p><em>Server Environment-</em>
parse-server: 3.2.3
mongodb: 4.0.2</p>

