How to resolve Uncaught ReferenceError: COLLECTION is not defined at <anonymous>:1:1 in Meteor.js/MongoDB<p>I am taking a full stack course via Eduonix.com. It seems that some of the code syntax is deprecated, as I have had to install older versions of multiple things to get through some of the sections. This did not help when I came to the Meteor.js section, so I installed the most recent and did some searching that allowed me to get through the first lesson. I tried the same for the second lesson (when I encountered this error), but have not had any luck with anything I have found.</p>

<p>I get this error when I try to use</p>

<pre><code>todos.find().fetch()
</code></pre>

<p>in the browser's console.</p>

<p><strong>Relevant File Structure:</strong></p>

<pre><code>client
--main.html
--main.js
lib
--collections.js
</code></pre>

<p><a href="https://github.com/CarsonBarry/FullStack-Course/tree/master/8-Meteor.js/Template/quicktodos" rel="nofollow noreferrer">View on github</a></p>

<p>In the course lesson, the line</p>

<pre><code>import { Todos } from '../lib/collections';
</code></pre>

<p>is not present in <strong>main.js</strong> and the line</p>

<pre><code>export const Todos = new Mongo.Collection('todos');
</code></pre>

<p>in <strong>collections.js</strong> is presented as</p>

<pre><code>Todos = new Mongo.Collection('todos');
</code></pre>

<p>I have tried changing </p>

<pre><code>import { Todos } from '../lib/collections';
</code></pre>

<p>to</p>

<pre><code>import { Todos } from '/lib/collections';
</code></pre>

<p>but it did nothing.</p>

<p>I have also tried just adding</p>

<pre><code>Todos = new Mongo.Collection('todos');
</code></pre>

<p>to <strong>main.js</strong>, but I got an error that said "todos" was already defined (only to get the same undefined error when I tried to run the console command, because somehow it was both already defined and is still undefined).</p>

<p>I have made these changes based on looking up similar issues online before making this post, hoping that it would save me like adding</p>

<pre><code>import './main.html';
</code></pre>

<p>to <strong>main.js</strong> did when I was getting a similar undefined error related to that prior to this error.</p>

<p><strong>main.html</strong></p>

<pre><code>&lt;head&gt;
  &lt;title&gt;QuickTodos&lt;/title&gt;
&lt;/head&gt;

&lt;body&gt;
  {{&gt; main}}
&lt;/body&gt;

&lt;Template name="main"&gt;
  &lt;header&gt;
    &lt;h1&gt;{{title}}&lt;/h1&gt;
  &lt;/header&gt;
  &lt;ul&gt;
    {{#each todos}}
      {{&gt; todo}}
    {{/each}}
  &lt;/ul&gt;
&lt;/template&gt;

&lt;template name="todo"&gt;
  &lt;li&gt;{{text}}&lt;/li&gt;
&lt;/Template&gt;
</code></pre>

<p><strong>main.js</strong></p>

<pre><code>import { Template } from 'meteor/templating';
import './main.html';
import { Todos } from '../lib/collections';

const todos = [
  {text:'Pickup kids from school'},
  {text:'Go food shopping'},
  {text:'Meeting with boss'}
];

Template.main.helpers({
  title(){
    return 'QuickTodos';
  },
  todos(){
    return todos;
  }
});
</code></pre>

<p><strong>collections.js</strong></p>

<pre><code>import {Mongo} from 'meteor/mongo';

export const Todos = new Mongo.Collection('todos');
</code></pre>

<p>When I run </p>

<pre><code>todos.find().fetch()
</code></pre>

<p>I expect to get an empty array, but instead I get:</p>

<pre><code>VM1905:1 
Uncaught ReferenceError: todos is not defined
    at &lt;anonymous&gt;:1:1
</code></pre>

<p>What am I doing wrong?</p>

